import animationMixin from '@/mixins/animation.js';
export default {
  mixins: [animationMixin],
  props: ['element'],
  mounted: function mounted() {
    this.runAnimations();
  },
  render: function render(h) {
    return h("div", {
      "style": this.element.getStyle({
        position: 'absolute'
      })
    }, [this.$slots.default]);
  }
};
